import img4 from "../src/images/6.jpg";
import img5 from "../src/images/7.jpg";

const Sdata = [
  { imgsrc: img1, cardtitle: "Portrait Photography" },
  { imgsrc: img2, cardtitle: "Product Photography" },
  { imgsrc: img3, cardtitle: "Wedding Photography" },
  { imgsrc: img4, cardtitle: "Jewellery Photography" },
  { imgsrc: img5, cardtitle: "Real Estate Photography" },
  { imgsrc: img6, cardtitle: "reative Professional Photography" },
